// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

// contract for healthcare marketplace
contract Ethology {
    address public owner;

    struct product {
        uint256 cost;
        uint256 productId;
        uint256 productCount;
    }

    enum Phase {
        Init,
        Stocking,
        Stocked,
        Completed
    }

    Phase public phase = Phase.Init;

    mapping(address => product[]) public customerPOList;

    function getCurrentPhase() public view returns (Phase) {
        return phase;
    }

    function updatePhase(Phase newPhase) public {
        if (msg.sender != owner) {
            revert("Only owner can update phase");
        }
        phase = newPhase;
    }

    constructor() public {
        owner = msg.sender;
    }

    function addProduct(
        uint256 productId,
        uint256 productCount,
        uint256 cost
    ) public {
        product memory newProduct = product(cost, productId, productCount);
        customerPOList[msg.sender].push(newProduct);
    }

    function getProduct(uint256 productId)
        public
        view
        returns (uint256 cost, uint256 productCount)
    {
        for (uint256 i = 0; i < customerPOList[msg.sender].length; i++) {
            if (customerPOList[msg.sender][i].productId == productId) {
                cost = customerPOList[msg.sender][i].cost;
                productCount = customerPOList[msg.sender][i].productCount;
                return (cost, productCount);
            }
        }
        cost = 0;
        productCount = 0;
    }
}
